import React, { Component } from "react";

function Home() {
    return (
      <Container fluid>
        <Row>
          <Col size="md-12">
            <Jumbotron className="Home">
              <h1>NewsIt</h1>
            </Jumbotron>
          </Col>
        </Row>
      </Container>
    );
  }
